import {Outlet, Link} from'react-router-dom';

function AdminDashboard({admin})  {
    return (
        <div>
            <h2>Admin Controls</h2>
            <div>
                <Link>Manage Courses</Link>
            </div>
            <div>
                <Link>Manage Teachers</Link>
            </div>
            <div>
                <Link>Manage Students</Link>
            </div>
        </div>
    )
}

export default AdminDashboard;
